import React from 'react';
import AppHeader from "../AppHeader";
import SearchPanel from "../SearchPanel";
import TodoFilter from "../TodoFilter";
import TodoList from "../TodoList";

const TodoData = [
    {label: 'Learn React'},
    {label: 'Drink Coffee'},
];


const App = () => {
    return (
        <div>
            <AppHeader/>
            <div>
                <SearchPanel/>
                <TodoFilter/>
            </div>
            <TodoList data = {TodoData} />
        </div>
    )
};

export default App;
